// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import { LibDiamond } from "../libraries/LibDiamond.sol";

/**
 * @title CounterFacet
 * @dev A sample facet that demonstrates basic diamond functionality with a simple counter
 *      This facet provides increment, decrement, and view operations for a counter value
 *      stored in diamond storage. It serves as an example of how to implement business
 *      logic in a diamond facet while using the diamond storage pattern.
 */
contract CounterFacet {
    // Custom storage struct for this facet
    struct CounterStorage {
        uint256 counter;
        address lastUpdater;
        uint256 lastUpdateTimestamp;
        mapping(address => uint256) userCounters;
    }

    // Storage position for this facet
    bytes32 constant COUNTER_STORAGE_POSITION = keccak256("counter.facet.storage");

    // Events
    event CounterIncremented(address indexed user, uint256 newValue);
    event CounterDecremented(address indexed user, uint256 newValue);
    event CounterReset(address indexed user, uint256 previousValue);
    event UserCounterUpdated(address indexed user, uint256 newValue);

    /**
     * @notice Get the counter storage
     * @dev Internal function to access the counter's diamond storage slot
     * @return cs The counter storage struct
     */
    function counterStorage() internal pure returns (CounterStorage storage cs) {
        bytes32 position = COUNTER_STORAGE_POSITION;
        assembly {
            cs.slot := position
        }
    }

    /**
     * @notice Increment the global counter by 1
     * @dev Increases the global counter and updates metadata
     */
    function increment() external {
        CounterStorage storage cs = counterStorage();
        cs.counter += 1;
        cs.lastUpdater = msg.sender;
        cs.lastUpdateTimestamp = block.timestamp;

        emit CounterIncremented(msg.sender, cs.counter);
    }

    /**
     * @notice Decrement the global counter by 1
     * @dev Decreases the global counter and updates metadata
     *      Reverts if counter would go below zero
     */
    function decrement() external {
        CounterStorage storage cs = counterStorage();
        require(cs.counter > 0, "CounterFacet: Counter cannot go below zero");

        cs.counter -= 1;
        cs.lastUpdater = msg.sender;
        cs.lastUpdateTimestamp = block.timestamp;

        emit CounterDecremented(msg.sender, cs.counter);
    }

    /**
     * @notice Reset the global counter to zero
     * @dev Only the diamond owner can reset the counter
     */
    function resetCounter() external {
        LibDiamond.enforceIsContractOwner();
        CounterStorage storage cs = counterStorage();

        uint256 previousValue = cs.counter;
        cs.counter = 0;
        cs.lastUpdater = msg.sender;
        cs.lastUpdateTimestamp = block.timestamp;

        emit CounterReset(msg.sender, previousValue);
    }

    /**
     * @notice Get the current global counter value
     * @return The current counter value
     */
    function getCounter() external view returns (uint256) {
        return counterStorage().counter;
    }

    /**
     * @notice Get metadata about the last counter update
     * @return lastUpdater Address of the last user to update the counter
     * @return lastUpdateTimestamp Timestamp of the last update
     */
    function getCounterMetadata() external view returns (address lastUpdater, uint256 lastUpdateTimestamp) {
        CounterStorage storage cs = counterStorage();
        return (cs.lastUpdater, cs.lastUpdateTimestamp);
    }

    /**
     * @notice Increment a user's personal counter
     * @dev Each user has their own counter independent of the global one
     */
    function incrementUserCounter() external {
        CounterStorage storage cs = counterStorage();
        cs.userCounters[msg.sender] += 1;

        emit UserCounterUpdated(msg.sender, cs.userCounters[msg.sender]);
    }

    /**
     * @notice Get a user's personal counter value
     * @param user The address of the user
     * @return The user's counter value
     */
    function getUserCounter(address user) external view returns (uint256) {
        return counterStorage().userCounters[user];
    }

    /**
     * @notice Set a user's counter to a specific value
     * @dev Only the user themselves or the diamond owner can set their counter
     * @param value The new counter value
     */
    function setUserCounter(uint256 value) external {
        CounterStorage storage cs = counterStorage();
        cs.userCounters[msg.sender] = value;

        emit UserCounterUpdated(msg.sender, value);
    }

    /**
     * @notice Set any user's counter (owner only)
     * @dev Only the diamond owner can set other users' counters
     * @param user The user whose counter to set
     * @param value The new counter value
     */
    function setUserCounterAsOwner(address user, uint256 value) external {
        LibDiamond.enforceIsContractOwner();
        CounterStorage storage cs = counterStorage();
        cs.userCounters[user] = value;

        emit UserCounterUpdated(user, value);
    }
}

contracts/facets/DiamondCutFacet.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

/******************************************************************************\
* Author: Nick Mudge <nick@perfectabstractions.com> (https://twitter.com/mudgen)
* EIP-2535 Diamonds: https://eips.ethereum.org/EIPS/eip-2535
*
* Implementation of the diamond cut functions.
/******************************************************************************/

import { LibDiamond } from "../libraries/LibDiamond.sol";
import { IDiamondCut } from "../interfaces/IDiamondCut.sol";
import { IERC165 } from "@openzeppelin/contracts/interfaces/IERC165.sol";

/**
 * @title DiamondCutFacet
 * @dev Implementation of the diamond cut functionality with a timelock mechanism.
 *      The diamond cut operation allows adding, replacing, or removing facets and functions
 *      from the diamond proxy contract. This implementation adds a security timelock
 *      that requires a two-step process (propose and execute) for diamond cuts,
 *      enhancing security by allowing time for review before execution.
 *      Based on the EIP-2535 Diamond Standard.
 */
contract DiamondCutFacet is IDiamondCut {
    /// @notice Propose a diamond cut to be executed after the timelock period
    /// @dev First step in the two-step process for modifying the diamond. This queues up
    ///      changes that can only be executed after a predefined timelock period.
    ///      Only the contract owner can propose changes.
    /// @param _diamondCut Contains the facet addresses and function selectors to add, replace, or remove
    /// @param _init The address of the contract or facet to execute initialization code
    /// @param _calldata A function call, including function selector and arguments, for initialization
    function proposeDiamondCut(
        IDiamondCut.FacetCut[] calldata _diamondCut,
        address _init,
        bytes calldata _calldata
    ) external {
        LibDiamond.enforceIsContractOwner();
        LibDiamond.proposeDiamondCut(_diamondCut, _init, _calldata);
    }

    /// @notice Execute a previously proposed diamond cut after the timelock period has elapsed
    /// @dev Second and final step in the two-step diamond modification process.
    ///      This executes the changes that were previously proposed, but only if
    ///      the required timelock period has passed. The timelock period is a
    ///      security measure to allow stakeholders time to review proposed changes.
    ///      Only the contract owner can execute the diamond cut.
    /// @custom:security Reverts if no diamond cut is proposed, if the timelock period
    ///                  hasn't expired, or if the initialization call fails
    function executeDiamondCut() external {
        LibDiamond.enforceIsContractOwner();
        LibDiamond.executeDiamondCut();
    }

    /// @notice Cancel a previously proposed diamond cut
    /// @dev Allows the contract owner to cancel a pending diamond cut proposal
    ///      before it is executed. This is useful if errors are found in the
    ///      proposed changes during the timelock period or if the changes
    ///      are no longer desired. Once cancelled, the proposal is completely
    ///      removed and a new proposal would need to be submitted if needed.
    /// @custom:security Only callable by the contract owner
    function cancelDiamondCut() external {
        LibDiamond.enforceIsContractOwner();
        LibDiamond.cancelDiamondCut();
    }

    /// @notice Add/replace/remove any number of functions and optionally execute initialization code
    /// @dev THIS FUNCTION IS DEPRECATED and will always revert when called.
    ///      It has been replaced by the more secure two-step process using
    ///      proposeDiamondCut() followed by executeDiamondCut(), which adds a timelock
    ///      security feature. This function remains to maintain compatibility with
    ///      the IDiamondCut interface but cannot be used.
    /// @custom:security Always reverts with an error message directing to the new functions
    function diamondCut(
        IDiamondCut.FacetCut[] calldata,
        address,
        bytes calldata
    ) external pure override {
        revert("Function deprecated: Use proposeDiamondCut() + executeDiamondCut() instead");
    }
}

contracts/facets/DiamondLoupeFacet.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

/******************************************************************************\
* Author: Nick Mudge <nick@perfectabstractions.com> (https://twitter.com/mudgen)
* EIP-2535 Diamonds: https://eips.ethereum.org/EIPS/eip-2535
*
* Implementation of the diamond loupe functions.
/******************************************************************************/

import { LibDiamond } from "../libraries/LibDiamond.sol";
import { IDiamondLoupe } from "../interfaces/IDiamondLoupe.sol";
import { IERC165 } from "@openzeppelin/contracts/interfaces/IERC165.sol";

/**
 * @title DiamondLoupeFacet
 * @dev Implementation of the DiamondLoupe standard which provides introspection functions
 *      to view what facets and functions are available in the diamond contract.
 *      The Diamond Loupe functions make it possible to look up facets and functions
 *      implemented by a diamond. This implementation is based on the EIP-2535 Diamond Standard.
 */
contract DiamondLoupeFacet is IDiamondLoupe, IERC165 {
    /// @notice Gets all facets and their selectors that are registered with the diamond
    /// @dev This function is used to inspect the full facet structure of the diamond
    /// @return facets_ An array of Facet structs containing the facet addresses and
    ///         their associated function selectors
    function facets() external override view returns (Facet[] memory facets_) {
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        uint256 numFacets = ds.facetAddresses.length;
        facets_ = new Facet[](numFacets);
        for (uint256 i; i < numFacets; i++) {
            address facetAddress_ = ds.facetAddresses[i];
            facets_[i].facetAddress = facetAddress_;
            facets_[i].functionSelectors = ds.facetFunctionSelectors[facetAddress_].functionSelectors;
        }
    }

    /// @notice Gets all the function selectors supported by a specific facet
    /// @dev Used to retrieve all function selectors managed by a single facet implementation
    /// @param _facet The facet address to query
    /// @return facetFunctionSelectors_ Array of function selectors (bytes4) supported by the facet
    function facetFunctionSelectors(address _facet) external override view returns (bytes4[] memory facetFunctionSelectors_) {
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        facetFunctionSelectors_ = ds.facetFunctionSelectors[_facet].functionSelectors;
    }

    /// @notice Get all the facet addresses registered in the diamond
    /// @dev Provides a complete list of implementation contracts that make up the diamond's functionality
    /// @return facetAddresses_ Array of all registered facet addresses
    function facetAddresses() external override view returns (address[] memory facetAddresses_) {
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        facetAddresses_ = ds.facetAddresses;
    }

    /// @notice Gets the facet address that implements a specific function
    /// @dev Used to determine which implementation contract handles a particular function.
    ///      This function is critical for understanding the diamond's current function routing.
    ///      If no facet is found for the selector, returns address(0).
    /// @param _functionSelector The 4-byte function selector to find the implementation for
    /// @return facetAddress_ The facet address implementing the function, or address(0) if not found
    function facetAddress(bytes4 _functionSelector) external override view returns (address facetAddress_) {
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        facetAddress_ = ds.selectorToFacetAndPosition[_functionSelector].facetAddress;
    }

    /// @notice Checks if the contract implements an interface
    /// @dev ERC-165 implementation that checks if the diamond supports a specific interface.
    ///      Returns true for IDiamondLoupe and IERC165 interfaces, and any additional
    ///      interfaces registered with the diamond.
    /// @param _interfaceId The interface identifier to check, as specified in ERC-165
    /// @return True if the contract implements the interface, false otherwise
    function supportsInterface(bytes4 _interfaceId) external view override returns (bool) {
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        return _interfaceId == type(IERC165).interfaceId || 
               _interfaceId == type(IDiamondLoupe).interfaceId ||
               ds.supportedInterfaces[_interfaceId];
    }
}

