// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import { LibDiamond } from "../libraries/LibDiamond.sol";
import { IERC173 } from "../interfaces/IERC173.sol";
import { IERC165 } from "@openzeppelin/contracts/interfaces/IERC165.sol";

/**
 * @title OwnershipFacet
 * @dev Implementation of the ERC-173 ownership standard for the Diamond proxy pattern.
 *      This facet manages the ownership of the diamond contract, which is a critical
 *      security consideration as the owner has complete control over the contract's
 *      functionality through diamond cuts. The ownership model follows the standard
 *      single-owner pattern where the owner can transfer ownership to another address.
 *      This facet implements both the IERC173 interface for ownership and the IERC165
 *      interface for standard interface detection.
 */
abstract contract OwnershipFacet is IERC173, IERC165 {
    /**
     * @notice Transfer ownership of the contract to a new address
     * @dev Only the current owner can call this function. This is a critical
     *      security function as the owner has complete control over the diamond.
     *      The ownership transfer happens immediately with no two-step process,
     *      so extreme care should be taken to ensure the new owner address is correct.
     *      Setting the owner to address(0) will effectively renounce ownership,
     *      leaving the contract without an owner and unable to perform privileged
     *      operations like diamond cuts.
     * @param _newOwner The address of the new owner
     */
    function transferOwnership(address _newOwner) external override {
        LibDiamond.enforceIsContractOwner();
        LibDiamond.setContractOwner(_newOwner);
    }

    /**
     * @notice Get the current contract owner's address
     * @dev This view function returns the address of the current owner
     *      without making any state changes. The owner is stored in the
     *      diamond storage pattern and retrieved through the LibDiamond library.
     *      The owner has exclusive privileges for critical operations including
     *      diamond cuts and transferring ownership.
     * @return owner_ The current owner address
     */
    function owner() external override view returns (address owner_) {
        owner_ = LibDiamond.contractOwner();
    }

    // Removed supportsInterface(bytes4) function.
    // This should be handled by DiamondLoupeFacet (ERC165).
}

