 * @title OwnershipFacet
 * @dev Implementation of the ERC-173 ownership standard for the Diamond proxy pattern.
 *      This facet manages the ownership of the diamond contract, which is a critical
 *      security consideration as the owner has complete control over the contract's
 *      functionality through diamond cuts. The ownership model follows the standard
 *      single-owner pattern where the owner can transfer ownership to another address.
 *      This facet implements both the IERC173 interface for ownership and the IERC165
