    /**
     * @notice Transfer ownership of the contract to a new address
     * @dev Only the current owner can call this function. This is a critical
     *      security function as the owner has complete control over the diamond.
     *      The ownership transfer happens immediately with no two-step process,
     *      so extreme care should be taken to ensure the new owner address is correct.
     *      Setting the owner to address(0) will effectively renounce ownership,
     *      leaving the contract without an owner and unable to perform privileged
     *      operations like diamond cuts.
     * @param _newOwner The address of the new owner
     */
